namespace KRG::Fonts::SegoeBold
{
    void GetFontCompressedData( TVector<Byte>& compressedData )
    {
        char const* dataBlocks[] =
        {
            segoeuib_compressed_data_base85_0,
            segoeuib_compressed_data_base85_1,
            segoeuib_compressed_data_base85_2,
            segoeuib_compressed_data_base85_3,
            segoeuib_compressed_data_base85_4,
            segoeuib_compressed_data_base85_5,
            segoeuib_compressed_data_base85_6,
            segoeuib_compressed_data_base85_7,
            segoeuib_compressed_data_base85_8,
            segoeuib_compressed_data_base85_9,
            segoeuib_compressed_data_base85_10,
            segoeuib_compressed_data_base85_11,
            segoeuib_compressed_data_base85_12,
            segoeuib_compressed_data_base85_13,
        };

        size_t dataBlockSizes[14];

        size_t totalSize = 0;
        for ( auto i = 0; i < 14; i++ )
        {
            dataBlockSizes[i] = strlen( dataBlocks[i] );
            totalSize += dataBlockSizes[i];
        }

        compressedData.resize( totalSize );

        size_t memoryCopiedSoFar = 0;
        for ( auto i = 0; i < 14; i++ )
        {
            memcpy( compressedData.data() + memoryCopiedSoFar, dataBlocks[i], dataBlockSizes[i] );
            memoryCopiedSoFar += dataBlockSizes[i];
        }
    }
}